    this.trigger = 'click';
  }

  protected fillPopup(): PopoverPopupComponent {
    const popupComponent = super.fillPopup();
    popupComponent.title = this.title;
    return popupComponent;
  }

  getContent(): string|TemplateRef {
    return this.content;
  }

}












